import React from "react";
import "./CitiHomepage.css";

const citi = [
  {
    name: "Dublin",
    subText: "123 properties",
    image: "./images/city_1.webp",
  },
  {
    name: "Reno",
    subText: "533 properties",
    image: "./images/city_2.webp",
  },
  {
    name: "Austin",
    subText: "532 properties",
    image: "./images/city_3.webp",
  },
];

function CitiHomepage() {
  return (
    <div className="homestay">
      <div className="img-1">
        <div className="name_text">
          <h2 className="name">{citi[0].name}</h2>
          <p className="subtext">{citi[0].subText}</p>
        </div>
        <img className="img" src={citi[0].image}></img>
      </div>
      <div className="img-2">
        <div className="name_text">
          <h2 className="name">{citi[1].name}</h2>
          <p className="subtext">{citi[1].subText}</p>
        </div>
        <img className="img" src={citi[1].image}></img>
      </div>
      <div className="img-3">
        <div className="name_text">
          <h2 className="name">{citi[2].name}</h2>
          <p className="subtext">{citi[2].subText}</p>
        </div>
        <img className="img" src={citi[2].image}></img>
      </div>
    </div>
  );
}

export default CitiHomepage;
